  //  const loginUserId = useContext()

    return(
        <div style={{border:"5px solid black", paddingBottom: "800px"}}>
           

            <div className="profile-top">
                <FaUserAlt className="icon"/>
                <p>name</p>  

            </div>
            
            <div className="prof">
                <div className="profile-list"><FaGlobe className="FaGlobe"/> Activity</div>
                <div className="profile-list"><FaUser className="FaUser"/>Profile</div>
                <div className="profile-list"><FaCommentDots className="FaCommentDots"/> Message</div>
                <div className="profile-list"><FaRegSun className="FaRegSun"/> Setting</div>
            </div>
        </div>
    )
}

export default ChatProfile;
